pragma solidity 0.6.2;

import "node_modules/@openzeppelin/contracts/token/ERC1155/ERC1155.sol";

contract ERC1155Certificate is ERC1155("test") {
  using SafeMath for uint; // SafeMathOpenZeppelinuint

  uint256 internal certificateId = 0;
  mapping (address => uint[]) public myCertificateId; // myCertificateIdIDmappinguint[]
  // mapping (uint256 => address) public certificateIssuer; // operator

  struct Certificate {
    uint256 id;
    string nameOfCertificate;
    bytes ipfsHash;
    address issuer;
    uint256 issuetime;
  }

  Certificate[] public certificates;

  constructor() public { }

  function issueCertificate(string calldata _nameOfCertificate, uint256 numberOfCertificate, address[] calldata _toAddresses, bytes calldata _data) external {
    certificateId = certificateId.add(1); // 6SafeMathNFT 1
    _mint(msg.sender, certificateId, numberOfCertificate, _data); //  OpenZeppelin
    certificates.push(Certificate(certificateId, _nameOfCertificate, _data, msg.sender, now)); // Certificatecertificates
    for (uint i = 0; i < numberOfCertificate; i++ ) {
      safeTransferFrom(msg.sender, _toAddresses[i], certificateId, 1, _data); // safeTransferFrom OpenZeppelin
      myCertificateId[_toAddresses[i]].push(certificateId); // id
    }
  }

  function getMyCertificateId(address _certificateHolder) external view returns (uint[] memory) {
    return myCertificateId[_certificateHolder]; // uint[]ID
  }

}
